import styled from "styled-components";

const MyPageComp = styled.div`
  width: 100%;
  margin-top: 150px;
  position: relative;
  .mypage_inner {
    width: 80%;
    margin: 0 auto;
    display: flex;
    padding: 40px 0;
    gap: 40px;
  }
`;
export default MyPageComp;
